import React, { Component } from "react";
import axios from "axios";
class Clock extends Component {
  constructor(props) {
    super(props);
    this.state = {
      post: [],
    };
  }
  componentDidMount() {
    axios
      .getpost(
        "https://api.nytimes.com/svc/topstories/v2/fashion.json?api-key=54368b8f-ee6d-4c1d-9695-e2a4d5b85170"
      )
      .then((response) => {
        this.setState({
          posts: response.posts,
        });
      });
  }
  componentWillUnmount() {}
  render() {
    console.log(this.state);
    return (
      <div>
        <h1>Hello, World!</h1>
      </div>
    );
  }
}

export default Clock;
